import * as React from "react";
import Moment from 'react-moment';
import AutoScale from 'react-auto-scale';
import gql from "graphql-tag";
import writtenNumber from "written-number";
import { useQuery, useMutation, useLazyQuery, useApolloClient } from "@apollo/react-hooks";
// Style
import './SlideFeed.styl'; 
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { 
    faArrowRight
} from '@fortawesome/free-solid-svg-icons'

// GQL
const REMARKS_BY_SLIDE_ID = gql`
    query getSlideRemarksBySlideId($SlideId: ID!, $PopulateInput:PopulateInput!) {
        getSlideRemarksBySlideId(SlideId:$SlideId, PopulateInput:$PopulateInput) {
            _id
            type
            priority
            title
            description
            completed
            assignee {
                _user {
                    _id
                    name
                    avatar
                }
                completed
            }
            allowReplies
            replies {
                value
                created
                _user {
                    name
                    avatar
                }
            }
            _user {
                name
                avatar
            }
        }
    }
`;
const SUBMIT_SLIDE_REMARK_REPLY = gql`
    mutation createSlideRemarkReply($SlideRemarkId:ID!, $SlideRemarkReplyInput:SlideRemarkReplyInput!) {
        createSlideRemarkReply(SlideRemarkId:$SlideRemarkId,  SlideRemarkReplyInput:$SlideRemarkReplyInput) 
    }
`;

// Types
type SlideFeedProps = {
    userCookie:UserCookie
}
type UserCookie = {
    _id:string
}

//
// Function
//

const SlideFeed: React.FunctionComponent<SlideFeedProps> = (props:any) => {
    // Set Stats
    const [getSlideRemarks, setSlideRemarks] = React.useState(null);
    const [getRemarkFilter, setRemarkFiler] = React.useState('all');
    const [getRemarkReply, setRemarkReply] = React.useState('');

    // GraphQL - M's
    const [ callCreateSlideRemarkReply, { loading:createSlideRemarkReplyLoading, error:createSlideRemarkReplyError }] = useMutation(SUBMIT_SLIDE_REMARK_REPLY);

    // GraphQL - Q's
     const [ getRemarksBySlideId, 
        { 
        loading:remarksLoading, 
        data:remarksData, 
        error:remarksError 
        }
    ] = useLazyQuery(REMARKS_BY_SLIDE_ID, { 
        fetchPolicy: "no-cache",
        errorPolicy: "all" 
    });

    //  
    // Use Effect
    //

    React.useEffect(() => {
        console.log(writtenNumber(1))
        if(!remarksData && !remarksError) {
            getRemarksBySlideId({ variables: {  
                SlideId:"5de51419f0c3396dd58af97d",
                PopulateInput: {
                    key: "assignee._user _user replies._user",
                    skip: 0,
                    limit: 20
                }
            }});
        } else {
            if(!getSlideRemarks) {
                console.log(remarksData)
                //setSlideRemarks(remarksData.getSlideRemarksBySlideId);
            }
        }
    },[remarksData, getSlideRemarks, setSlideRemarks]);

    //
    // Filter Remarks
    //

    const filterRemarks = async (type:string) => {
        setRemarkFiler(type);
        if(type === 'all') {
            setSlideRemarks(remarksData.getSlideRemarksBySlideId);
        } else {
            setSlideRemarks(remarksData.getSlideRemarksBySlideId.filter(item => item.type === type));
        }
    }

    //
    // Submit Remark Reply
    //

    const submitRemarkReply = async (event) => {
        event.preventDefault();
        console.log(event.target.value);
        // if (event.key === 'Enter') {
        //     if(getRemarkReply.length !== 0) {
        //         try {
        //             const res = await callCreateSlideRemarkReply({ 
        //                 variables: {  
        //                     "SlideRemarkId": "5e387a89a3691510112c7db4",
        //                     "SlideRemarkReplyInput": {
        //                         "value": getRemarkReply
        //                     }
        //                 }
        //             });
        //             console.log(res)
        //             if(res.data.createSlideRemarkReply) {

        //             }
        //         } catch(err) {
        //             console.log(`Login Error (`+err+`)`)
        //         }
        //     }
        // }
    }

    //
    // Return
    //

    return (
        <>
            {/** Feed Slide Info */}
            <div className="feed-slide-info">
                <div className="info-header">
                    <div className="header-button header-button-active">In Progress</div><div className="header-text">or</div><div className="header-button">Finished</div>
                </div>
                <div className="info-agenda">
                    <div className="agenda-label">Slide Purpose</div>
                    <h1>Sell Sell Sell</h1>
                    <p>The agenda for this slide is purely to sell our capabilities.</p>
                    <div className="info-status">
                        <div className="status-item">
                            <p>Due Date</p>
                            <h1>24th July 1984</h1>
                        </div>
                        <div className="status-item">
                            <p>Slide Status</p>
                            <h1>In Progress</h1>
                        </div>
                    </div>
                    <div className="agenda-users">
                        <div className="users-item">
                            <div className="item-avatar">
                                <div className="avatar-prompt">
                                    <div className="prompt-owner">Owner</div>
                                </div>
                                J
                            </div>
                            <div className="item-name">Joe</div>
                        </div>
                        <div className="users-item">
                            <div className="item-avatar">
                                <div className="avatar-prompt">
                                    <div className="prompt-success">Done</div>
                                </div>
                                A
                            </div>
                            <div className="item-name">April</div>
                        </div>
                        <div className="users-item">
                            <div className="item-avatar">
                                <div className="avatar-prompt">
                                    <div className="prompt-working">Working</div>
                                </div>
                                L
                            </div> 
                            <div className="item-name">Lee</div>
                        </div>
                        <div className="clear-float"></div>
                    </div>
                </div> 
            </div>
            {/** Feed */}
            <div className="feed-filter">
                <div className={ getRemarkFilter === 'all' ? 'filter-button filter-button-active':'filter-button'} onClick={(event) => filterRemarks('all')}>All</div>
                <div className={ getRemarkFilter === 'task' ? 'filter-button filter-button-active':'filter-button'}  onClick={(event) => filterRemarks('task')}>Tasks</div>
                <div className={ getRemarkFilter === 'comment' ? 'filter-button filter-button-active':'filter-button'}  onClick={(event) => filterRemarks('comment')}>Comments</div>
            </div>
            {getSlideRemarks && 
                <>
                {getSlideRemarks.length === 0 && <>Currently No  {getRemarkFilter !== 'all' && <>{getRemarkFilter}'s </> } {getRemarkFilter === 'all' && <>Task's or Comment's </> } </>}
                    {getSlideRemarks.map((value, index) => {
                        return( 
                            <div className="feed-item" key={index}>
                                {/** Header */}
                                <div className="item-header">
                                    {value['priority'] === 'high' && <div className="header-priority high-priority">{value['priority']}</div>}
                                    {value['priority'] === 'medium' && <div className="header-priority medium-priority">{value['priority']}</div>}
                                    {value['priority'] === 'low' && <div className="header-priority low-priority">{value['priority']}</div>}
                                    <div className="header-id">{value['_id']}</div>
                                </div>  
                                {/** Title, Date, Description */}
                                <div className="item-body">
                                    <div className="body-title">{value['title']}</div>
                                    <div className="body-date">
                                        <Moment format="D MMM YYYY" withTitle>{value['created']}</Moment>
                                    </div>
                                    <div className="body-description">{value['description']}</div>
                                </div>
                                {/** Assign */}
                                { value.assignee.length !== 0 && 
                                    <>
                                        <div className="item-assign">
                                            <div className="assign-members">
                                                <div className="members-label">Assigned by</div>
                                                <div className="members-avatar">{value['_user']['name'][0]}</div>
                                                <div className="members-arrow">
                                                    <FontAwesomeIcon icon={faArrowRight}/>
                                                </div>
                                                <div className="clear-float"></div>
                                            </div>
                                            <div className="assign-members">
                                                <div className="members-label">Assigned to</div>
                                                {/** Assigned */}
                                                {value.assignee.map((assVal, assIn) => {
                                                    return (
                                                        <div className="members-avatar" key={index+'-'+assIn}>{assVal['_user']['name'][0]}</div>
                                                    );
                                                })}
                                                <div className="clear-float"></div>
                                            </div>
                                        </div>                                        
                                   </>
                                }
                                <div className="clear-float"></div>
                                {/** Replies */}
                                { value.allowReplies &&
                                    <div className="item-replies">
                                        { value.replies.length !== 0 &&
                                            value.replies.map((replyValue, replyIndex) => {
                                                return( 
                                                    <div key={index+'-'+replyIndex}>    
                                                        <div className={ replyIndex + 1 === value.replies.length ? 'replies-item replies-item-last':'replies-item' }>
                                                            <div className="item-user-avatar">{replyValue._user.name[0]}</div>
                                                            <div className="item-user-full-name">{replyValue._user.name}</div>
                                                            <div className="item-created-date">
                                                                <Moment format="D MMM YYYY" withTitle>{replyValue.created}</Moment>
                                                            </div>
                                                            <div className="item-reply">
                                                                {replyValue.value}
                                                            </div>
                                                        </div>
                                                    </div>        
                                        )})}
                                    </div>
                                }
                                <div className="clear-float"></div>
                                {/** Status - In Progress, Done */}
                                { value.assignee.length !== 0 && value.assignee.map((assVal, assIn) => {
                                    return (
                                        assVal['_user']['_id'] === props.userCookie._id &&
                                        <div key={index+'-'+assIn}>
                                            <div className="item-status">
                                                <div className="status-text">Mark as</div>
                                                <div className={ !value['complete'] ? 'status-button status-button-active':'status-button'}>In Progress</div>
                                                <div className="status-text">or</div>
                                                <div className={ value['complete'] ? 'status-button status-button-active':'status-button'}>Done</div>
                                            </div>
                                        </div>
                                    );
                                })}
                            </div>
                        )
                    })}
                </>
            } 
        </>
    );
};

export default SlideFeed
